function SeasonTile(){

    const {year} = useState();


    useEffect(
        () => {
          const fetchMatch = async () => {
            const response = await fetch(`http://localhost:8081/dashboard/allSeasons`);
            const data = await response.json();
            setMatch(data);
          }

        fetchMatch();

        }, [year]
      );

    return(
        <div>
            <h1>Season Tile</h1>
        </div>
    );
}

export default SeasonTile;
